import React, { useState } from 'react';
// import Popup from "./Popup";
import { Modal, Button } from "react-bootstrap";

export default function Card() {

    const [openpop, setOpenpop] = useState(false)


    return (
        <>
            <div className="project-card">
                <h2>Card-1</h2>
                    <div className='popup'>
                    <Modal size="lg" show={openpop} onHide={() => setOpenpop(false)}>
                        <Modal.Body>
                            <h3>this is popu body</h3>
                        </Modal.Body>
                        <Button variant="danger" onClick={() => setOpenpop(false)}>Close Popup</Button>
                    </Modal>
                </div>
            </div>
        </>
    )
}
